define("__BYPASS__",true);
$_SERVER["argv"][1] = "cleodis";
include(dirname(__FILE__)."/../../global.inc.php");

ATF::db()->begin_transaction();

ATF::commande()->q->reset()->whereIsNotNull("date_debut")->whereIsNotNull("date_evolution");
$commandes=ATF::commande()->sa();
$count=count($commandes);
$i=0;
foreach($commandes as $key=>$item){
	$i++;
	$commande = new commande_cleodis($item['id_commande']);
	$affaire = $commande->getAffaire();
	$affaires_parentes=array();
	if ($ap = $affaire->getParentAR()) {
		foreach ($ap as $a) {
			$affaires_parentes[] = new affaire_cleodis($a["id_affaire"]);
		}
	} elseif ($affaire->get('id_parent')) {
		$affaire_parente = $affaire->getParentAvenant();
	}
	$devis = $affaire->getDevis();
	print_r("\n".$i."/".$count." ".$item["ref"]);
	ATF::facturation()->insert_facturations($commande,$affaire,$affaires_parentes,$devis);
}




