$pattern="/INSERT .+;/";
preg_match_all($pattern,$str,$tab);
foreach($tab[0] as $item){
	
	$pattern1="/[(][0-9]+, [0-9]+,/";
	preg_match_all($pattern1,$item,$tab1);

	foreach($tab1[0] as $item1){
		$pattern2="/ [0-9]+/";
		preg_match_all($pattern2,$item1,$tab2);
		$id_affaire=intval($tab2[0][0]);
	}

	$pattern3="/[0-9]{4}-[0-9]{2}-[0-9]{2}/";
	preg_match_all($pattern3,$item,$tab3);
	$date_debut=$tab3[0][0];
	$date_fin=$tab3[0][1];

	$pattern4="/prolongation|contrat/";
	preg_match_all($pattern4,$item,$tab4);
	$type=$tab4[0][0];

	ATF::facturation()->q->reset()->addCondition("id_affaire",$id_affaire)
								  ->addCondition("date_periode_debut",$date_debut)
								  ->addCondition("date_periode_fin",$date_fin);
	if($facturation=ATF::facturation()->sa()){
		ATF::facturation()->d($facturation[0]["id_facturation"]);
		print_r("\n nouveau");
		print_r($item);
		print_r("\n ancien");
		print_r($facturation);
		ATF::db()->query($item);
	}else{
		if($type=='contrat'){
			ATF::db()->query($item);
		}else{
			ATF::db()->query($item);
		}
	}
}
ATF::db()->commit_transaction();


